pragma solidity 0.8.3;

import "../ERC721Collection.sol";

contract UnicornDetectiveAgency is ERC721Collection {
    mapping(uint256 => string) private _episodeAppearances;

    event AppearedOnEpisode (uint256 indexed tokenId, string describer);

    constructor(
        string memory name,
        string memory symbol,
        uint256 price,
        uint256 maxTotalMint,
        uint256 maxPreSaleMintPerAddress,
        uint256 maxMintPerTransaction,
        uint256 maxAllowedGasFee,
        string memory contractURI,
        string memory placeholderURI,
        address raribleRoyaltyAddress,
        address openSeaProxyRegistryAddress
    ) ERC721Collection(
        name,
        symbol,
        price,
        maxTotalMint,
        maxPreSaleMintPerAddress,
        maxMintPerTransaction,
        maxAllowedGasFee,
        contractURI,
        placeholderURI,
        raribleRoyaltyAddress,
        openSeaProxyRegistryAddress
    ) {}

    function addEpisodeAppearance(uint256 tokenId, string memory describer) external onlyOwner {
        _episodeAppearances[tokenId] = describer;
        emit AppearedOnEpisode(tokenId, describer);
    }

    function getEpisodeAppearances(uint256 tokenId) external view returns (string memory) {
        return _episodeAppearances[tokenId];
    }

    function tokenNameByIndex(uint256 tokenId) public view returns (string memory) {
        string memory prefix = string(abi.encodePacked("Citizen #", Strings.toString(tokenId)));
        if (bytes(_episodeAppearances[tokenId]).length > 0) {
            return string(abi.encodePacked(prefix, " ", _episodeAppearances[tokenId]));
        } else {
            return prefix;
        }
    }
}
